import React from 'react';
import { Typography, Container } from '@mui/material';

function Expenses() {
  return (
    <Container>
      <Typography variant="h4" sx={{ mt: 4, mb: 2 }} color="primary">
        Expenses
      </Typography>
      <Typography>
        Track and manage expenses here.
      </Typography>
    </Container>
  );
}

export default Expenses;
